  summary: >-
    An iterator that does not support <xref uid="com.azure.cosmos.implementation.guava25.collect.UnmodifiableIterator.remove" data-throw-if-not-resolved="false">#remove</xref>.


    `UnmodifiableIterator` is used primarily in conjunction with implementations of <xref uid="com.azure.cosmos.implementation.guava25.collect.ImmutableCollection" data-throw-if-not-resolved="false">ImmutableCollection</xref>, such as <xref uid="com.azure.cosmos.implementation.guava25.collect.ImmutableList" data-throw-if-not-resolved="false">ImmutableList</xref>. You can, however, convert an existing iterator to an `UnmodifiableIterator` using <xref uid="com.azure.cosmos.implementation.guava25.collect.Iterators.unmodifiableIterator" data-throw-if-not-resolved="false">Iterators#unmodifiableIterator</xref>.
